import React, { Component } from 'react';
import '../css/Footer.css'
import facebook from '../svg/social_media_fb.svg';
class Footer extends React.Component {
    render() {
      return (
        <footer className="Footer">
        <p>
          REACH ME OUT @ <a className="Footer-link"
                   href="mailto:luca.cesarano1@gmail.com"
                   rel="noopener noreferrer">
                   LUCA.CESARANO1@GMAIL.COM</a>
        </p>
        <svg xmlns="http://www.w3.org/2000/svg" width="48" height="48" viewBox="0 0 48 48"><path d="M9 8h-3v4h3v12h5v-12h3.642l.358-4h-4v-1.667c0-.955.192-1.333 1.115-1.333h2.885v-5h-3.808c-3.596 0-5.192 1.583-5.192 4.615v3.385z"/></svg>        </footer>
      );
    }
  }

  export default Footer;
